import {connect} from "react-redux";
import ForgotPassword from "./ForgotPassword";
import {setToggleForgotPassword} from "../../redux/NavBarReducer";
import {sendEmailCode} from "../../redux/ForgotPasswordReducer";

let mapStateToProps = (state) => {
  return {
    email: state.forgotPass.email,

    toggleForgorPassword: state.navbar.toggleForgorPassword
  }
}

const ForgotPasswordContainer = connect(mapStateToProps, {
  setToggleForgotPassword, sendEmailCode
})(ForgotPassword);

export default ForgotPasswordContainer;
